Unseen Universe: Series 2

Science Documentary hosted by Rob Quirk, published by UKTV in 2013 - English narration


Information
------------------------------

Unseen Universe: Series 2
This two-part documentary goes in pursuit of the invisible - a world so alien to us, that at times we find it hard to recognise it as our own. Seeing the world in super-slowmotion allows us to explain mysteries of science and explore super-fast phenomena. It is a cinematic expedition into the incredible world of invisible movement


1)  Frozen Moments 
Part one of two. Slow-motion cameras capture what happens when a caterpillar metamorphoses into a butterfly and scrutinise the movements of acrobats in a circus.

2)  Magical Motions 
Part two of two. The slow-motion cameras explore what is really happening in a cave full of bats, capture one of the fastest fish on Earth and scrutinise butterflies.

